#![allow(non_snake_case)]

mod common;

macro_rules! gen_dev_integration_test {
    ($(($test_name:ident, $path:literal);)+) => {
      $(
         #[tokio::test]
          async fn $test_name() {
            use nut_webgui_upsmc::{
              UpsName,
              clients::{AsyncNutClient, NutClient}
            };

            let ups_name = UpsName::new_unchecked("UPS_DEVICE");
            let path = std::path::Path::new($path);
            let var_list = crate::common::DeviceDumpFile::new(&ups_name.to_string(), &path).unwrap();
            let prot_response = var_list.into_prot_response().unwrap();

            let stream = tokio_test::io::Builder::new()
              .write(format!("LIST VAR {}\n", ups_name).as_bytes())
              .read(prot_response.as_bytes())
              .build();

            let mut client = NutClient::from(stream);
            let var_list = client.list_var(&ups_name).await.unwrap();

            assert_eq!(ups_name, var_list.ups_name);
            assert_eq!(var_list.variables.len(), prot_response.lines().count() - 2);
          }
    )+
  };
}

